import React, { useState, useEffect } from "react";
import "./Projects.css"; 

function Projects() {
  const [projects, setProjects] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {

    fetch("https://jsonplaceholder.typicode.com/users")
      .then((response) => response.json())
      .then((data) => {
        // Mocking project data since JSONPlaceholder does not have projects
        const formattedData = data.slice(0, 5).map((user, index) => ({
          id: index + 1,
          name: `Project ${index + 1}`,
          author: user.name,
          languages: ["JavaScript", "React", "Node.js"],
          description: `A sample project by ${user.name} showcasing frontend and backend skills.`,
        }));
        setProjects(formattedData);
        setLoading(false);
      })
      .catch((error) => {
        console.error("Error fetching projects:", error);
        setLoading(false);
      });
  }, []);

  return (
    <div className="container my-5">
      <h1 className="text-center">My Projects</h1>

      {loading ? (
        <p className="text-center">Loading projects...</p>
      ) : (
        <div className="row">
          {projects.map((project) => (
            <div key={project.id} className="col-md-4">
              <div className="card project-card">
                <div className="card-body">
                  <h5 className="card-title">{project.name}</h5>
                  <h6 className="card-subtitle mb-2 text-muted">By {project.author}</h6>
                  <p className="card-text">{project.description}</p>
                  <p>
                    <strong>Languages:</strong> {project.languages.join(", ")}
                  </p>
                </div>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
}

export default Projects;
